import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
// import CreateAccount from './screens/CreateAccount';
import Home from './screens/Home';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home/>}/>
      </Routes>
      <div>
        <Home/>
      </div>
    </BrowserRouter>
  );
}

export default App;
